import React from "react";
import css from "./style.css";
import {
  //   useGetData,
  usePostData,
  //   useEditData,
  //   useDeleteData,
} from "../../../axios/hooks";
import { Button, Modal } from "antd";
import { useState } from "react";
import "antd/dist/reset.css";
import { useForm } from "react-hook-form";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCoffee } from "@fortawesome/free-solid-svg-icons";

export default function PostProduct() {
  const post = usePostData("/products");
  const [nm, setNm] = useState();
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  const onSubmit = (data) =>
    postData({
      ...data,
      price: Number(data.price),
      discount: Number(data.discount),
    });
  // console.log(errors);

  const postData = (data) => {
    post.mutate(data, {
      onSuccess: (post) => console.log(post, "data"),
      onError: (error) => console.log(error, "error"),
    });
  };

  //   if (isLoading) {
  //     return <p>isLoading</p>;
  //   }
  //   if (isError) {
  //     return <p>error check your internet</p>;
  //   }
  const [open, setOpen] = useState(false);
  return (
    <div id="form">
      <>
        <FontAwesomeIcon icon="faCoffee" />
        <Button type="primary" onClick={() => setOpen(true)}>
          Create post
          <FontAwesomeIcon icon="fa-regular fa-pen" />
        </Button>
        <Modal
          title="Create post"
          centered
          open={open}
          onOk={() => setOpen(false)}
          onCancel={() => setOpen(false)}
          width={1000}
        >
          <>
            <form onSubmit={handleSubmit(onSubmit)}>
              <input type="text" placeholder="Type" {...register("type", {})} />
              <input
                type="checkbox"
                placeholder="Active"
                {...register("active", {})}
              />
              <input type="text" placeholder="Size" {...register("size", {})} />
              <div className="form-flex">
                <h4>Both</h4>
                <input
                  {...register("gender")}
                  type="radio"
                  value="Both"
                  placeholder="gender"
                />
                <h4>Male</h4>
                <input
                  {...register("gender")}
                  type="radio"
                  value=" Men"
                  placeholder="gender"
                />
                <h4>Famale</h4>
                <input
                  {...register("gender")}
                  type="radio"
                  value=" Woman"
                  placeholder="gender"
                />
              </div>
              <input
                type="text"
                placeholder="Color"
                {...register("color", {})}
              />
              <input
                type="text"
                placeholder="Name_UZ"
                {...register("name_Uz", {})}
              />
              <input
                type="text"
                placeholder="Name_RU"
                {...register("name_Ru", {})}
              />
              <input
                type="text"
                placeholder="Name_EN"
                {...register("name_En", {})}
              />
              <input
                type="number"
                placeholder="Price"
                {...register("price", {})}
              />
              <input
                type="number"
                placeholder="Discount"
                {...register("discount", {})}
              />
              <input
                type="text"
                placeholder="description_Uz"
                {...register("description_Uz", {})}
              />
              <input
                type="text"
                placeholder="description_Ru"
                {...register("description_Ru", {})}
              />
              <input
                type="text"
                placeholder="description_En"
                {...register("description_En", {})}
              />
              <input
                type="text"
                placeholder="Category_ID"
                {...register("categoryId", {})}
              />
              <input
                type="text"
                placeholder="Photo_id"
                {...register("photoId", {})}
              />
              <input type="submit" />
            </form>
          </>
        </Modal>
      </>
    </div>
  );
}
